    public void Registr(String valor1)
    {
        Data.Vacuna Vacu = new Data.Vacuna();
        Vacu.Nombre = valor1;

        using (VacunateRDContext context = new VacunateRDContext())
        {
            context.Add(Vacu);
            context.SaveChanges();
            valo = 1;
        }

    }
    public void ValdiarDat()
    {

        if (Vacuna.Length > 0)
        {
            Registr(Vacuna);
